import Link from 'next/link';

export default () => (
    <div>
        <h1>Home</h1>
        <Link href="/about"><a>Go to the about page</a></Link>
        <p>Welcome to the home page</p>
        <img src="/static/logo.png" alt="JS" height="200px"/>
    </div>
);
